import './App.css';
import { QueryClient, QueryClientProvider } from '@tanstack/react-query'
import Buttons from './custom_hook_1/Buttons';


function App() {
  const client = new QueryClient()


  return (
    <div className="App">
      <QueryClientProvider client={client}>
        <Buttons />
      </QueryClientProvider>
    </div>
  );
}

export default App;
